import React from "react";
import Card from "../UI/Card";

const DisplayItem = props=>{
    console.log(props.users);
    return(
        <Card>
            <ul>{props.users.map(val =>{
            return <li>
                {val.name}
                {val.age}
            </li>        
            })             
        }</ul>
        </Card>
    );
};

export default DisplayItem;
